import React from "react";
import Profile from "./profile";
import ProfileLine from "./profileLine";

export default function ProfileGroup({ digimons, direction }) {
    const flexRowAndAlignEnd = {flexDirection: "row", alignSelf: "flex-end"};
    const flexRowAndAlignStart = {flexDirection: "row", alignSelf: "flex-start"};
    const flexRow = {flexDirection: "row"};
    const flexColumn = {flexDirection: "column"};

    if(direction === "right") {
        if(digimons?.length === 1) {
            if(digimons[0].down !== undefined && digimons[0].down !== null) {
                return (<div className="profile-group" style={flexRow} key={`${digimons[0].from}`}>
                            <ProfileGroup digimons={digimons[0].down} direction={direction} key={`${digimons[0].from}_group`}></ProfileGroup>
                            <ProfileLine digimon={digimons[0]} direction={direction} key={`${digimons[0].from}_line`}></ProfileLine>
                            <Profile digimon={digimons[0]} key={`${digimons[0].from}`}></Profile>
                        </div>);
            } else {
                return (<div className="profile-group" style={flexRow} key={`${digimons[0].from}_group`}>
                            <Profile digimon={digimons[0]} key={`${digimons[0].from}`}></Profile>
                        </div>);
            }
        } else if(digimons?.length > 1) {
            return (
                <div className="profile-group" style={flexColumn} >
                    { digimons.map(digimon => {
                        if(digimon.down === undefined || digimon.down === null) {
                            if(digimon.type === "유년기1" || digimon.type === "유년기2")
                                return <Profile digimon={digimon} align={"end"} key={`${digimon.from}`}></Profile>;
                            else
                                console.log("digimons3 - only profile", direction, digimons)
                                return (<div className="profile-group">
                                    <ProfileLine digimon={digimon} direction={direction} key={`${digimon.from}_line`}></ProfileLine>
                                    <Profile digimon={digimon} align={"end"} key={`${digimon.from}`}></Profile>
                                </div>);
                        } else if(direction === "right") {
                            return (<div className="profile-group" style={flexRowAndAlignEnd} key={`${digimon.from}_group`}>
                                        <ProfileGroup digimons={digimon.down} direction={direction} key={`${digimon.from}_group_1`}></ProfileGroup>
                                        <ProfileLine digimon={digimon} direction={direction} key={`${digimon.from}_line`}></ProfileLine>
                                        <Profile digimon={digimon} key={`${digimon.from}`}></Profile>
                                    </div>);
                        } else {
                            return (<ProfileGroup digimons={digimon.down} direction={direction} key={`${digimon.from}_group`}></ProfileGroup>);
                        }
                    })}
                </div>
            );
        }
    } else {
        if(digimons?.length === 1) {
            if(digimons[0].up !== undefined && digimons[0].up !== null) {
                return (<div className="profile-group" style={flexRow} key={`${digimons[0].from}_group`}>
                            <Profile digimon={digimons[0]} key={`${digimons[0].from}`}></Profile>
                            <ProfileLine digimon={digimons[0]} direction={direction} key={`${digimons[0].from}_line`}></ProfileLine>
                            <ProfileGroup digimons={digimons[0].up} direction={direction} key={`${digimons[0].from}_group`}></ProfileGroup>
                        </div>);
            } else {
                return (<div className="profile-group" style={flexRow}>
                            <Profile digimon={digimons[0]} key={`${digimons[0].from}`}></Profile>
                        </div>);
            }
        } else if(digimons?.length > 1) {
            return (
                <div className="profile-group" style={flexColumn} >
                    { digimons.map(digimon => {
                        if(digimon.up === undefined || digimon.up === null) {
                            if(digimon.type === "궁극체" || digimon.type === "완전체")
                                return <Profile digimon={digimon} align={"start"} key={`${digimon.from}`}></Profile>;
                            else
                                return (<div className="profile-group" style={flexRowAndAlignStart} key={`${digimon.from}_group`}>
                                    {/* <ProfileLine digimon={digimon} direction={direction}></ProfileLine> */}
                                    <Profile digimon={digimon} align={"start"} key={`${digimon.from}`}></Profile>
                                </div>);
                        } else {
                            return (<div className="profile-group" style={flexRowAndAlignStart}>
                                        <Profile digimon={digimon}></Profile>
                                        <ProfileLine digimon={digimon} direction={direction}></ProfileLine>
                                        <ProfileGroup digimons={digimon.up} direction={direction}></ProfileGroup>
                                    </div>);
                        }
                    })}
                </div>
            );
        }
    }
}
